import React from "react";

const AddUser = () => {
    return (
        <div>
            <div>
                <label>Username</label>
                <input />
            </div>
            <div>
                <label>Age (Years)</label>
                <input />
            </div>
            <button>Add User</button>
        </div>
    );
};

export default AddUser;
